import React, {Component} from 'react';

import Navbar from './Navbar';

class SinglePost extends Component{

	constructor(props){
		super(props);

		this.state = {
			loading:false,
			posts: [],
			error: ''
		}
	}

	

	render(){
		return(
			<div>
				<Navbar/>
			</div>
		)
	}
}

export default SinglePost;
